;&lt;p class=&quot;MsoNormal&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;长财愿景&lt;/span&gt; : &amp;nbsp;&lt;span&gt;成为中国管理咨询行业领导品牌和受尊敬的投资人。&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;长财价值观&lt;/span&gt; : &amp;nbsp;&lt;span&gt;善良，尽责，高效，共赢&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;长财咨询团队是由几十位拥有&lt;/span&gt;20&lt;span&gt;余年企业高管、财务总监、人力资源总监经验的资深专业人士组成，来自各种类型的企业，如：跨国公司、民营企业、集团公司、上市公司、会计师事务所等等；来自各行各业，如：制造业、服务业、高科技行业、房地产、医药行业、连锁零售、互联网、软件、金融保险机构、能源行业、快速消费品行业、汽车业等等；可以提供各种财务、激励管理的实战经验、工具、案例、技能辅导。&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;span&gt;长财咨询将对老板、管理层、专业人员等进行立体化的陪伴服务，紧紧围绕企业管理实践，为企业解决实际的老板财富管理与安全、企业财务管理、激励机制搭建、薪酬绩效管理、股权激励、人才培养、资本运作等问题，以帮助企业管理升级、财税疑问即时解决，陪伴企业成长。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;blockquote style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;margin-left:40px;border-width:initial;border-style:none;border-color:initial;font-size:13.3333px;white-space:normal;&quot;&gt;&lt;blockquote style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;margin-left:40px;border-width:initial;border-style:none;border-color:initial;&quot;&gt;&lt;blockquote style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;margin-left:40px;border-width:initial;border-style:none;border-color:initial;&quot;&gt;&lt;blockquote style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;margin-left:40px;border-width:initial;border-style:none;border-color:initial;&quot;&gt;&lt;blockquote style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;margin-left:40px;border-width:initial;border-style:none;border-color:initial;&quot;&gt;&lt;blockquote style=&quot;paddi